import logo from './logo.svg';
import './App.css';
import React from 'react';
import {BrowserRouter, Route,Routes} from 'react-router-dom';
import NewAnime from './components/Anime/NewAnime';
import ShowAll from './components/Anime/ShowAll';
import ShowOne from './components/Anime/ShowOne';
import UpdateOne from './components/Anime/UpdateOne';
import { io } from 'socket.io-client';

const socket = io.connect("http://localhost:8000")



const App=()=> {

  return (
    <BrowserRouter>
      <div className="App">
        <Routes>
            <Route element={<ShowAll/>} path=""></Route>
            <Route element={<ShowAll/>} path="/home"></Route>
            <Route element={<ShowOne/>} path="/showOne/:aid"></Route>
            <Route element={<UpdateOne/>} path="/edit/:aid"></Route>
            <Route element={<NewAnime/>} path="/createNew/"></Route>
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
